import React from 'react';
import { intro } from './intro.module.scss';

const Intro = () => {
  return (
    <div className={intro}>
      <h1>Hello</h1>
      <h3>I'm Diogo Ribeiro</h3>
      <p>And I'm a Designer</p>
    </div>
  );
};

export default Intro;
